import React from "react";
import {
  BrowserRouter as Router,
  Route,
  Redirect,
  Switch
} from 'react-router-dom';

import ArticleMangement from "./ArticleMangement";
import App from "../App";


function Navbar() {
  let routes;

  routes=(
    <switch>
      <Route path="/Article" exact>
        <ArticleMangement />
      </Route>

      <Route path="/" exact>
        <App />
      </Route>
    </switch>
  );
  return (
    <nav>
      <h2>Blog System</h2>
      <div className="nav-right">
        <button>Login</button>
        <main>{routes}</main>
      </div>
    </nav>
  );
}

export default Navbar;
